(3, 'MUDAH MENDAFTAR HAJI', 'CARA MUDAH DAFTAR HAJI PLUS DI ROSANA TRAVEL, RESMI DAN AMAN ', '<p>Melaksanakan ibadah haji merupakan bagian dari rukun islam yang kelima, dimana ibadah haji ini di wajibkan bagi yang telah mampu. Ibadah haji merupakan ibadah yang sangat di impikan oleh seluruh umat muslim di dunia. Karena Allah menjanjikan surga bagi hambanya yang melaksanakan sebenar – benarnya Ibadah Haji. Nabi SAW mengabarkan, “Dan haji mabrur tidak ada balasan yang pantas baginya selain surga.” (HR. Bukhari dan Muslim).</p><p>Ibadah haji memiliki dua jenis cara pendaftaran, yakni haji regular dan haji plus. Haji regular dikelola dan di selenggarakan secara langsung oleh pemerintah melalui Kementrian Agama Republik Indonesia. Sedangkan haji plus dikelola dan di selenggarakan oleh biro perjalanan yang telah memiliki izin resmi dari pemerintah Indonesia.</p><p>Dengan daftar tunggu haji regular yang terlalu lama, menjadikan haji plus sebagai solusi bagi masyarakat yang ingin melaksanakan Ibadah Haji tanpa harus menunggu waktu yang lama. Rosana travel bisa menjadi pilihan anda untuk dapat merealisasikan pelaksanaan Ibadah Haji anda tanpa harus menunggu terlalu lama. Rosana Travel merupakan biro perjalanan wisata yang telah memiliki ijin sebagai Penyelenggara Ibadah Haji Khusus dari Kementrian Agama Republik Indonesia (izin PIHK nomor 193). Selain itu, Rosana Travel memiliki beberapa pilihan paket Ibadah Haji diantaranya :</p><p>1. Haji Plus Kuota system SISKOHAT RI, berangkat urut kacang sesuai nomor porsi dari pemerintah&nbsp; (Estimasi 7-9 tahun)</p><p>2. Haji Non Kuota tanpa antri, langsung berangkat di tahun 2025 / 1446H</p><p>3. Haji Non Kuota Tabungan, berangkat 2-3 tahun</p><p>Hal-hal yang perlu diperhatikan saat anda akan melaksanakan Ibadah Haji pertama kali yakni memilih agen travel yang tepat. Berikut cara memilih agen travel yang tepat sebagai langkah awal cara daftar haji plus:</p><p>1. Pastikan biro dan agen travel PIKH (Penyelenggara Ibadah Haji Khusus) telah mengantongi izin resmi dan terdaftar di Kementrian Agama Republik Indonesia. Caranya datanglah dan tanyakan langsung pada petugas di Kantor Departemen Agama, atau anda bisa mengecek secara langsung dengan mengakses website resmi Kementrian Agama Republik Indonesia</p><p>2. Cari testimoni dan bertanya kepada keluarga, kerabat atau relasi yang sebelumnya telah memakai jasa travel haji tersebut.</p><p>3. Pastikan fasilitas yang anda dapatkan sesuai dengan uang yang akan anda keluarkan. Jangan tergiur mendapatkan harga murah. Jika agen travel tersebut memang profesional, mereka tidak akan segan membeberkan fasilitas dan rincian biaya secara transparan kepada calon jamaah haji.</p><p>4. Pastikan jadwal keberangkatan pada agen travel. Hindari agen travel yang hanya memperkirakan waktu pemberangkatan. Sebab setiap agen travel haji yang resmi pasti sudah memiliki kouta VISA dan tanggal keberangkatan yang pasti.</p><p>5. Pertimbangkan untuk memilih travel haji yang memiliki fasilitas berupa asuransi bagi calon jemaah.</p><p>Jadi bagi anda yang telah memiliki niat untuk melaksanakan Ibadah Haji, segera daftarkan diri anda untuk melaksanakan Ibadah Haji bersama Rosana Travel. Tidak perlu ragu, Rosana Travel telah berpengalaman lebih dari 25 tahun mengantar dan menemani para tamu – tamu Allah menuju Baitullah. Daftar Ibadah Haji di Rosana Travel mudah, resmi, aman, dan cepat. Berikut tata cara pendaftaran Haji Rosana Travel :</p><p>1. Membayar setoran awal sebesar $5000</p><p>2. Menyerahkan fotocopy Paspor 3 lembar (nama di paspor minimal 3 kata nama)</p><p>3. Menyerahkan fotocopy KTP &amp; KK @3 lembar</p><p>4. Menyerahkan fotocopy Akte lahir / Ijazah / surat nikah 3 lembar (pilih salah satu)</p><p>5. Menyerahkan pas foto berwarna dengan ukuran :</p><p>• ukuran 4x6 sebanyak 15 lembar</p><p>• ukuran 3x4 sebanyak 25 lembar</p><p>dengan catatan : wajah 80%, background putih, tidak memakai kacamata, bagi wanita memakai jilbab selain warna putih, bagi laki-laki tidak memakai kopyah</p><p>6. Menyerahkan surat kesehatan dari puskesmas atau klinik</p><p>Jika pembayaran dan berkas telah lengkap, Hanya dalam waktu 24 jam calon jamaah haji langsung mendapatkan BPIH (Biaya Perjalanan Ibadah Haji) resmi dari Kemenntrian Agama Republik Indonesia. Selain mendapatkan BPIH, calon jamaah haji juga langsung mendapatkan nomor porsi haji pasti berangkat.</p><p>Jadi tunggu apalagi? segera daftarkan diri anda untuk melaksanakan Ibadah Haji bersama Rosana Travel</p><p>Kami siap melayani perjalanan Ibadah Haji anda secara professional, aman, dan nyaman. Serahkan pendaftaran ibadah Haji anda kepada kami, dan dapatkan BPIH dan nomor porsi langsung berangkat</p><p>&nbsp;</p><p>Informasi Ibadah Haji lebih lanjut hubungi layanan online Rosana Travel :</p><p><a href=\"https://api.whatsapp.com/send?phone=628113003258&amp;text=Hai%20assalamualaikum%20mohon%20info%20tentang%20paket%20Umroh%20dan%20Haji\"><img src=\"https://rosanatourtravel.com/wp-content/uploads/2020/11/Membuat-Link-WhatsApp-Dengan-Gambar-removebg-preview-300x118.png\" alt=\"\" width=\"300\" height=\"118\"></a><br>&nbsp;</p><p>Kunjungi kami di sosial media kami</p><p>Instagram : @rosanatourtravel</p><p>Facebook : RosanaTourAndTravel</p><p>Youtube : Rosana Travel</p>', '561eb51d155218b3859459fee7905787.png', 'Rosana Travel', '2023-12-12 10:27:52'),
(4, 'MUDAH MENDAFTAR HAJI', 'DAFTAR HAJI DI ROSANA TRAVEL MAKIN MUDAH, SISTEM ONLINE 24 JAM LANGSUNG DAPAT BPIH PASTI BERANGKAT  ', '<p>Ibadah haji adalah salah satu ibadah wajib bagi umat muslim yang telah mampu. Naik haji merupakan rukun islam ke lima yang menjadi impian banyak umat muslim. Tetapi terkadang Sebagian orang tidak benar – benar memahami perbedaan antara ibadah haji dan ibadah umroh. Padahal keduanya memiliki banyak perbedaan diantaranya waktu pelaksanaanya, syarat-syaratnya, dan tata cara pelaksanaan ibadahnya.<br>&nbsp;</p><p>Ibadah umroh dapat dilakukan kapan saja sepanjang tahun. Tetapi lain halnya dengan ibadah haji, Ibadah haji dapat dilaksanakan mulai dari bulan Syawal hingga hari kesepuluh bulan Dzulhijjah. Mewujudkan impian Ibadah Haji kini lebih mudah bersama Rosana Travel. Dalam zaman digital seperti saat ini, Rosana Travel telah menyediakan proses pendaftaran haji secara online yang dapat dilakukan di kantor Rosana Travel. Para calon jamaah haji tidak perlu menunggu terlalu lama. Hanya dalam waktu 24 jam calon jamaah haji langsung mendapatkan BPIH (Biaya Perjalanan Ibadah Haji) resmi dari Mentri Agama Republik Indonesia. Selain mendapatkan BPIH, calon jamaah haji juga langsung mendapatkan nomor porsi haji pasti berangkat.</p><p>Jadi bagi anda yang telah memiliki niat untuk melaksanakan Ibadah Haji, segera daftarkan diri anda untuk melaksanakan Ibadah Haji bersama Rosana Travel. Tidak perlu ragu, Rosana Travel telah berpengalaman lebih dari 25 tahun mengantar dan menemani para tamu – tamu Allah menuju Baitullah. Rosana Travel merupakan penyelenggara ibadah haji khusus yang telah memiliki izin resmi dari Mentri Agama Republik Indonesia (Izin PIHK resmi no 193).</p><p>Kami siap melayani perjalanan Ibadah Haji anda secara professional, aman, dan nyaman. Serahkan pendaftaran ibadah Haji anda kepada kami, dan dapatkan BPIH dan nomor porsi langsung berangkat</p><p>Informasi Ibadah Haji lebih lanjut hubungi layanan online Rosana Travel :<br><br>Kunjungi kami di sosial media kami<br><br>Instagram : @rosanatourtravel<br>Facebook : RosanaTourAndTravel<br>Youtube : Rosana Travel</p>', 'e9775e4dc43d1412359e6dbb348bcbe8.png', 'Rosana Travel', '2023-12-12 16:48:42'),
(5, 'UMROH UNGGULAN ROSANA TRAVEL', 'ROSANA TRAVEL, AHLINYA UMROH PRIVATE, DIJEMPUT DENGAN KENDARAAN PRIBADI', '<p>Produk andalan Rosana Travel yang ini yaitu Umroh Private dengan dijemput kendaraan pribadi. Dengan umroh bersama rosana travel, kalian bisa menentukan (request) tanggal dengan paket umroh private ini.</p><p>Bagi calon jamaah yang setiap harinya sibuk, dan ingin melaksanakan Ibadah Umroh, paket inilah solusinya. Paket umroh ini sangat cocok untuk jamaah yang sulit mendapatkan cuti libur karena pekerjaan.</p><p>Rosana Travel sangatlah mengedepankan pelayanan bagi jamaah umroh agar mendapatkan pelayanan yang terbaik. Ditambahlagi dengan hotel bintang 5 di Makkah dan Madinah yang menambah kepuasan jamaah umroh private. Selain itu, ada guide khusus yang menemani jamaah umroh private.</p><p>Ayo yang sudah merencanakan akan melaksanakan Ibadah Umroh Private.</p><p>Ingin Umroh dijemput menggunakan kendaraan pribadi? Rosana Travel solusinya yaa..</p><p>Untuk reservasi dan informasi tentang paket Umroh Bonus Kereta Cepat bisa hubungi nomor Admin dibawah ini:</p><p><br>www.rosanatravel.com<br>Instagram: rosanatourtravel<br>Facebook: RosanaTourAndTravel<br>Youtube: Rosana Travel</p>', '086aa7dd17b5fef84f9c32ef784d9f1f.png', 'Rosana Travel', '2023-12-12 16:51:46'),
(6, 'TABUNGAN UMROH', 'HANYA DENGAN 20 RIBU, SEMUA ORANG BISA UMROH BERSAMA ROSANA TRAVEL', '<p>Hanya dengan 20 ribu, semua orang bisa umroh</p><p>Pergi untuk melaksanakan Ibadah Umroh pasti sudah menjadi impian dari semua umat Islam,<br>Namun untuk mewujudkan impian itu, membutuhkan dana yang tidak sedikit<br>Tabungan umroh merupakan salah satu satu cara jitu untuk mewujudkan impian anda agar bisa melaksanakan Ibadah Umroh ke Tanah Suci</p><p>Tenang, tabungan umroh kini tidak perlu menguras kantong anda terlalu dalam<br>di Rosana Travel, dengan uang Rp. 20.000 anda bisa menabung untuk mewujudkan mimpi beribadah Umroh ke Tanah Suci</p><p>Jadi tunggu apa lagi?<br>Ibadah Umroh tidak harus menunggu banyak uang<br>Rencanakan tabungan untuk menunaikan Ibadah Umroh mulai dari sekarang</p><p>Rosana Travel hadir dengan program Tabungan Umroh Mabrur (TABRUR)<br>Tabungan Umroh Mabrur merupakan program tabungan terencana dari Rosana Travel yang bekerja sama dengan Bank Syariah Indonesia. Dengan Tabungan Umroh Mabrur, jamaah diharapkan menabung secara rutin setiap bulan dengan sistem Virtual Account yang cepat dan praktis. Tabungan Umroh Mabrur ini terjangkau, hanya dengan setoran awal minimal Rp. 3.000.000, anda sudah selangkah lebih dekat untuk melaksanakan Ibadah Umroh</p><p>Keunggulan program \"TABRUR\" Rosana Travel :&nbsp;<br>Mudah, pendaftaran program Tabrur hanya dengan KTP dan email<br>Aman, dengan sistem virtual account&nbsp;<br>Gratis, biaya admin<br>Praktis, tidak perlu repot melakukan konfirmasi pembayaran</p><p>Info lebih lanjut hubungi Layanan Online Rosana Travel :</p><p>www.rosanatravel.com<br>Instagram: rosanatourtravel<br>Facebook: RosanaTourAndTravel<br>Youtube: Rosana Travel</p>', 'c9c4e6f94c4d9edc10c28f8cb476db30.png', 'Rosana Travel', '2023-12-13 08:24:56'),
(7, 'WISATA HALAL TOUR', 'LIBURAN KE TURKI MUDAH DAN MURAH BERSAMA ROSANA TRAVEL', '<p>Taukah anda bahwa Turki adalah negara yang pertama dan satu-satunya yang telah membuka pintu wisata untuk&nbsp; para wisatawan dari berbagai&nbsp; mancanegara, salah satunya adalah Indonesia . Pada tanggal 24 Juni 2020, Turki mengenalkan “<i>Safe Tourism Certificated Programme</i>” untuk mendukung upaya mengembalikan pariwisata dengan memperhatikan protokol kesehatan.&nbsp; Dikutip dari laman&nbsp;<a href=\"http://www.tga.gov.tr/\">www.tga.gov.tr</a>, program “<i>Safe Tourism Certificated</i>” merupakan serangkaian tindakan ekstensif yang meliputi transportasi dan akomodasi untuk semua warga negara Turki dan pengunjung Internasional yang akan liburan ke Turki,&nbsp; juga kesejahteraan dan kondisi kesehatan penumpang/tamu dan karyawan yang bekerja di fasilitas wisata.</p><p>Turki menjadi destinasi liburan yang mencakup keindahan dua benua yakni Eropa dan Asia, selain itu Turki juga dikenal sebagai Negeri Sejuta Sejarah Islam. Berikut adalah 4 destinasi wajib saat liburan ke turki:</p><ol><li>Hagia Sophia, Topkapi Palace, Blue Mosque Hippodrome</li><li>Capadocia</li><li>Grand Mosque, Silk Market, Ancient City, Hierapolis</li><li>Ankara City Tour</li></ol><p>Bagi anda yang ingin liburan aman dimasa pandemi, Turki merupakan salah satu negara yang paling kami rekomendasikan. Biaya yang dikeluarkan cukup&nbsp;<i>affordable</i>&nbsp;dengan destinasi wisata yang cantik dan unik, bersejarah dan pengalaman yang tak akan terlupakan.&nbsp; Jadi tidak usah ragu lagi untuk liburan ke Turki. Rosana Travel merupakan jasa travel halal tour terbaik di Jawa Timur. Cukup dengan pasport saja, anda sudah bisa liburan ke Turki. Kami siap melayani anda dengan profesional, anda tinggal duduk manis dan serahkan seluruh kebutuhan transportasi dan akomodasi anda liburan ke Turki kepada kami. Informasi cepat dan pelayanan tepat hubungi marketing kami </p><p>081-3003-258</p><p>Kunjungi kami di sosial media kami<br>Instagram : @rosanatourtravel<br>Facebook : RosanaTourAndTravel<br>Youtube : Rosana Travel</p>', '4644f64e44ccde2c911499f2687e45d4.png', 'Rosana Travel', '2023-12-13 08:31:56'),
