(9, 'MUDAH MENDAFTAR HAJI', 'DAFTAR HAJI DI NIPINDO TRAVEL MAKIN MUDAH, SISTEM ONLINE 24 JAM LANGSUNG DAPAT BPIH PASTI BERANGKAT  ', '<p>Ibadah haji adalah salah satu ibadah wajib bagi umat muslim yang telah mampu. Naik haji merupakan rukun islam ke lima yang menjadi impian banyak umat muslim. Tetapi terkadang Sebagian orang tidak benar – benar memahami perbedaan antara ibadah haji dan ibadah umroh. Padahal keduanya memiliki banyak perbedaan diantaranya waktu pelaksanaanya, syarat-syaratnya, dan tata cara pelaksanaan ibadahnya.<br>&nbsp;</p><p>Ibadah umroh dapat dilakukan kapan saja sepanjang tahun. Tetapi lain halnya dengan ibadah haji, Ibadah haji dapat dilaksanakan mulai dari bulan Syawal hingga hari kesepuluh bulan Dzulhijjah. Mewujudkan impian Ibadah Haji kini lebih mudah bersama Nipindo &nbsp;Travel. Dalam zaman digital seperti saat ini, Nipindo Travel telah menyediakan proses pendaftaran haji secara online yang dapat dilakukan di kantor Nipindo Travel. Para calon jamaah haji tidak perlu menunggu terlalu lama. Hanya dalam waktu 24 jam calon jamaah haji langsung mendapatkan BPIH (Biaya Perjalanan Ibadah Haji) resmi dari Mentri Agama Republik Indonesia. Selain mendapatkan BPIH, calon jamaah haji juga langsung mendapatkan nomor porsi haji pasti berangkat.</p><p>Jadi bagi anda yang telah memiliki niat untuk melaksanakan Ibadah Haji, segera daftarkan diri anda untuk melaksanakan Ibadah Haji bersama Nipindo Travel. Tidak perlu ragu, Nipindo Travel telah berpengalaman lebih dari 25 tahun mengantar dan menemani para tamu – tamu Allah menuju Baitullah. Nipindo &nbsp;Travel merupakan penyelenggara ibadah haji khusus yang telah memiliki izin resmi dari Mentri Agama Republik Indonesia (Izin PIHK resmi no 193).</p><p>Kami siap melayani perjalanan Ibadah Haji anda secara professional, aman, dan nyaman. Serahkan pendaftaran ibadah Haji anda kepada kami, dan dapatkan BPIH dan nomor porsi langsung berangkat</p><p>Informasi Ibadah Haji lebih lanjut hubungi layanan online Nipindo Travel :<br><br>Kunjungi kami di sosial media kami<br><br>www.nipindotravel.com<br>Instagram: @nipindotourtravel<br>Facebook: Nipindo Tour and Travel</p>', '3927a302c4f3d25e3b9a39d8bdece96b.png', 'Nipindo Travel', '2023-12-12 16:48:42'),
(10, 'UMROH UNGGULAN NIPINDO TRAVEL', 'NIPINDO TRAVEL, AHLINYA UMROH PRIVATE, DIJEMPUT DENGAN KENDARAAN PRIBADI', '<p>Produk andalan Nipindo Travel yang ini yaitu Umroh Private dengan dijemput kendaraan pribadi. Dengan umroh bersama Nipindo travel, kalian bisa menentukan (request) tanggal dengan paket umroh private ini.</p><p>Bagi calon jamaah yang setiap harinya sibuk, dan ingin melaksanakan Ibadah Umroh, paket inilah solusinya. Paket umroh ini sangat cocok untuk jamaah yang sulit mendapatkan cuti libur karena pekerjaan.</p><p>Nipindo Travel sangatlah mengedepankan pelayanan bagi jamaah umroh agar mendapatkan pelayanan yang terbaik. Ditambahlagi dengan hotel bintang 5 di Makkah dan Madinah yang menambah kepuasan jamaah umroh private. Selain itu, ada guide khusus yang menemani jamaah umroh private.</p><p>Ayo yang sudah merencanakan akan melaksanakan Ibadah Umroh Private.</p><p>Ingin Umroh dijemput menggunakan kendaraan pribadi? Nipindo Travel solusinya yaa..</p><p>Untuk reservasi dan informasi tentang paket Umroh Bonus Kereta Cepat bisa hubungi nomor Admin dibawah ini:</p><p><br>www.nipindotravel.com<br>Instagram: @nipindotourtravel<br>Facebook: Nipindo Tour and Travel</p>', '759e055496a1cf83400ebec285a9bb8b.png', 'Nipindo Travel', '2023-12-12 16:51:46'),
(11, 'TABUNGAN UMROH', 'HANYA DENGAN 20 RIBU, SEMUA ORANG BISA UMROH BERSAMA NIPINDO TRAVEL', '<p>Hanya dengan 20 ribu, semua orang bisa umroh</p><p>Pergi untuk melaksanakan Ibadah Umroh pasti sudah menjadi impian dari semua umat Islam,<br>Namun untuk mewujudkan impian itu, membutuhkan dana yang tidak sedikit<br>Tabungan umroh merupakan salah satu satu cara jitu untuk mewujudkan impian anda agar bisa melaksanakan Ibadah Umroh ke Tanah Suci</p><p>Tenang, tabungan umroh kini tidak perlu menguras kantong anda terlalu dalam<br>di Nipindo Travel, dengan uang Rp. 20.000 anda bisa menabung untuk mewujudkan mimpi beribadah Umroh ke Tanah Suci</p><p>Jadi tunggu apa lagi?<br>Ibadah Umroh tidak harus menunggu banyak uang<br>Rencanakan tabungan untuk menunaikan Ibadah Umroh mulai dari sekarang</p><p>Nipindo Travel hadir dengan program Tabungan Umroh Mabrur (TABRUR)<br>Tabungan Umroh Mabrur merupakan program tabungan terencana dari Nipindo Travel yang bekerja sama dengan Bank Syariah Indonesia. Dengan Tabungan Umroh Mabrur, jamaah diharapkan menabung secara rutin setiap bulan dengan sistem Virtual Account yang cepat dan praktis. Tabungan Umroh Mabrur ini terjangkau, hanya dengan setoran awal minimal Rp. 3.000.000, anda sudah selangkah lebih dekat untuk melaksanakan Ibadah Umroh</p><p>Keunggulan program \"TABRUR\" Nipindo Travel :&nbsp;<br>Mudah, pendaftaran program Tabrur hanya dengan KTP dan email<br>Aman, dengan sistem virtual account&nbsp;<br>Gratis, biaya admin<br>Praktis, tidak perlu repot melakukan konfirmasi pembayaran</p><p>Info lebih lanjut hubungi Layanan Online Nipindo Travel :</p><p>www.nipindotravel.com<br>Instagram: @nipindotourtravel<br>Facebook: Nipindo Tour and Travel</p>', 'e491ff5e03641817ad4a061880237bd1.png', 'Nipindo Travel', '2023-12-13 08:24:56'),
(12, 'WISATA HALAL TOUR', 'LIBURAN KE TURKI MUDAH DAN MURAH BERSAMA NIPINDO TRAVEL', '<p>Taukah anda bahwa Turki adalah negara yang pertama dan satu-satunya yang telah membuka pintu wisata untuk&nbsp; para wisatawan dari berbagai&nbsp; mancanegara, salah satunya adalah Indonesia . Pada tanggal 24 Juni 2020, Turki mengenalkan “<i>Safe Tourism Certificated Programme</i>” untuk mendukung upaya mengembalikan pariwisata dengan memperhatikan protokol kesehatan.&nbsp; Dikutip dari laman&nbsp;<a href=\"http://www.tga.gov.tr/\">www.tga.gov.tr</a>, program “<i>Safe Tourism Certificated</i>” merupakan serangkaian tindakan ekstensif yang meliputi transportasi dan akomodasi untuk semua warga negara Turki dan pengunjung Internasional yang akan liburan ke Turki,&nbsp; juga kesejahteraan dan kondisi kesehatan penumpang/tamu dan karyawan yang bekerja di fasilitas wisata.</p><p>Turki menjadi destinasi liburan yang mencakup keindahan dua benua yakni Eropa dan Asia, selain itu Turki juga dikenal sebagai Negeri Sejuta Sejarah Islam. Berikut adalah 4 destinasi wajib saat liburan ke turki:</p><ol><li>Hagia Sophia, Topkapi Palace, Blue Mosque Hippodrome</li><li>Capadocia</li><li>Grand Mosque, Silk Market, Ancient City, Hierapolis</li><li>Ankara City Tour</li></ol><p>Bagi anda yang ingin liburan aman dimasa pandemi, Turki merupakan salah satu negara yang paling kami rekomendasikan. Biaya yang dikeluarkan cukup&nbsp;<i>affordable</i>&nbsp;dengan destinasi wisata yang cantik dan unik, bersejarah dan pengalaman yang tak akan terlupakan.&nbsp; Jadi tidak usah ragu lagi untuk liburan ke Turki. Rosana Travel merupakan jasa travel halal tour terbaik di Jawa Timur. Cukup dengan pasport saja, anda sudah bisa liburan ke Turki. Kami siap melayani anda dengan profesional, anda tinggal duduk manis dan serahkan seluruh kebutuhan transportasi dan akomodasi anda liburan ke Turki kepada kami. Informasi cepat dan pelayanan tepat hubungi marketing kami </p><p>081-3003-258</p><p>Kunjungi kami di sosial media kami<br>Instagram : @rosanatourtravel<br>Facebook : RosanaTourAndTravel<br>Youtube : Rosana Travel</p>', '4644f64e44ccde2c911499f2687e45d4.png', 'Nipindo Travel', '2023-12-13 08:31:56'),
(13, 'UMROH PROMO', 'UMROH 16 HARI DAPAT POTONGAN 3 JUTA ?', '<p>Memangnya masih ada Umroh dengan potongan harga fantastis ?<br>Umroh dengan durasi yang panjang, bisa puas menikmati Kota Suci Mekkah dan Madinah untuk beribadah sekaligus healing.<br>Dengan durasi 16 Hari bisa bebas puas eksplorasi</p><p>&nbsp;</p><p>Ingin menjalani perjalanan spiritual ke Tanah Suci dengan kenyamanan dan harga terbaik? Inilah kesempatan Anda! Bergabunglah dengan Paket Umroh 16 Hari kami yang menakjubkan, dengan keberangkatan eksklusif dari Surabaya pada Bulan Oktober 2024, November 2024, Januari 2025 dan Februari 2025. Dan yang lebih menarik, nikmati potongan harga super sebesar Rp. 3 Juta!</p><p>Mengapa Pilih Paket Umroh 16 Hari dari Surabaya?<br>1. Keberangkatan Spesial: Mulailah perjalanan spiritual Anda dengan keberangkatan eksklusif dari Surabaya pada tanggal Bulan Oktober 2024, November 2024, Januari 2025 dan Februari 2025. Waktu yang sempurna untuk meraih berkah dan mendapatkan pengalaman umroh yang tak terlupakan.</p><p>2. Rute yang Mendalam: Kunjungi tempat-tempat suci dan bersejarah dengan rute perjalanan yang dirancang khusus untuk memenuhi kebutuhan rohaniah Anda. Setiap langkah akan menjadi bagian dari perjalanan spiritual yang membangun.</p><p>3. Starting dari Jakarta/Surabaya: Kami mengerti kebutuhan Anda. Memulai perjalanan dari Surabaya memberikan kenyamanan dan kemudahan bagi mereka yang berada di wilayah Timur Indonesia.</p><p>4. Akomodasi Terbaik: Nikmati penginapan di hotel-hotel bintang lima yang telah kami pilih dengan hati-hati, memberikan kenyamanan maksimal selama perjalanan Anda.</p><p>Manfaatkan Super Discount Rp. 3 Juta:<br>Hemat uang Anda dengan potongan harga super sebesar Rp. 3 Juta. Kami berkomitmen untuk membuat pengalaman Umroh terjangkau tanpa mengorbankan kualitas. Segera daftar dan nikmati manfaat eksklusif ini!</p><p>Cara Mendaftar:<br>Pilih Tanggal: Pilih tanggal Bulan Oktober 2024, November 2024, Januari 2025 dan Februari 2025 untuk memulai perjalanan Anda.<br>Hubungi Kami: Segera hubungi tim kami untuk informasi lebih lanjut dan pendaftaran.<br>Siapkan Diri Anda: Bersiaplah untuk pengalaman spiritual yang penuh berkah.<br>Jangan lewatkan kesempatan langka ini! Bergabunglah dengan ribuan jamaah yang telah menjalani Umroh bersama kami. Hubungi kami sekarang dan buatlah perjalanan spiritual Anda menjadi lebih berarti dengan Paket Umroh 16 Hari, Keberangkatan Bulan Oktober 2024, November 2024, Januari 2025 dan Februari 2025, dan potongan super sebesar Rp. 3 Juta!</p><p>Catatan: Harga dan ketersediaan dapat berubah. Segera hubungi kami untuk informasi lebih lanjut dan reservasi.</p><p>&nbsp;</p><p>Info lebih lanjut hubungi Layanan Online Nipindo Travel :</p><p>www.nipindotravel.com<br>Instagram: @nipindotourtravel<br>Facebook: Nipindo Tour and Travel</p>', '', 'Nipindo Travel', '2023-12-16 09:41:50'),
(14, 'TOUR', 'TOUR LINTAS 3 NEGARA - KUALA LUMPUR, BANGKOK, SINGAPORE', '<p>HALAL TOUR TIGA NEGARA ( KUALA LUMPUR – BANGKOK – SINGAPORE)<br>Pernahkah Anda membayangkan sebuah petualangan yang menggabungkan keanekaragaman budaya, arsitektur yang memukau, serta kelezatan kuliner dari tiga negara yang berbeda? Jika iya, maka tour tiga negara yang mengunjungi Kuala Lumpur, Bangkok, dan Singapura mungkin adalah pilihan tepat untuk Anda. Setiap kota menawarkan pengalaman yang unik dan tak terlupakan bagi para wisatawan. Mari kita eksplorasi lebih dalam apa yang bisa anda harapkan dari setiap destinasi ini.<br>Kuala Lumpur, Malaysia: Modernitas dengan Sentuhan Budaya <br>Kuala Lumpur Adalah ibukota Malaysia, perpaduan harmonis antara kemodernan dan warisan budaya yang kaya. Salah satu ikonnya adalah Menara Kembar Petronas yang megah, yang menawarkan pemandangan spektakuler kota dari ketinggian. Nantinya kita akan mengunjungi beberapa destinasi wisata di Kuala Lumpur diantaranya : Istana Negara (Photo Stop), Dataran Merdeka (Photo Stop).<br>Bangkok, Thailand: Pusat Kehidupan Malam dan Budaya yang Memikat<br>Bangkok adalah ibukota Thailand, kota yang tak pernah tidur dengan kehidupan malam yang berdenyut. destinasi wisata yang akan kita kunjungi di Bangkok diantaranya : Erawadee Herb Shop, Wat Arun, Wat Pho dengan patung Reclining Buddha-nya dan Istana Kerajaan Grand Palace yang megah menawarkan pengalaman spiritual dan sejarah yang mendalam, makan siang di Restoran Lokal. Lalu ke Honey Bee Shop, Gems Jewerly, Dried Food, dan yang terakhir mengunjungi Asiatique the Riverfront.<br>Singapore: Metropolis Futuristik dengan Sentuhan Tradisional<br>Singapore menggambarkan masa depan yang futuristik dengan gedung pencakar langit modernnya yang mengagumkan seperti Merlion Park (Photo Stop), Esplanade (Photo Stop), Universal Studio Singapore (Photo Stop), Bugis Street, Orchard Road.</p><p><strong>Dan perlu digaris bawahi Rosana Travel Selain mengunjungi pusat ibu kota dari tiga negara diatas, kami juga Menggunakan Full by pesawat untuk Lintas Tiga Negara, </strong><br><strong>Makanan yang kami hidangkan juga dijamin 100% Halal</strong></p><p>Jadi bagaimana Yuk ikuti kami Explore keindahan 3 Negara Kuala Lumpur - Bangkok – Singapore. Biaya yang dikeluarkan cukup affordable dengan destinasi wisata yang cantik dan unik, bersejarah dan pengalaman yang tak akan terlupakan.  Jadi tidak usah ragu lagi untuk Explore bareng kita mengkelilingi tiga negara. Rosana Travel merupakan jasa travel halal tour terbaik di Jawa Timur. Kami siap melayani anda dengan profesional, anda tinggal duduk manis dan serahkan seluruh kebutuhan transportasi dan akomodasi anda explore tiga negara kepada kami. Informasi cepat dan pelayanan tepat hubungi kami.<br>????08113003258<br>????081133360600<br>www.rosanatravel.com<br>IG: @rosanatourtravel<br>FB: Rosana Tour And Travel<br>YT: Rosana Travel<br>TikTok: https://vt.tiktok.com/ZSYyRmYee/</p>', '1f022ecff20432a1261aa674fac66c15.jpeg', 'Rosana Travel', '2024-07-10 09:27:42'),
(15, 'UMROH PRIVATE', 'UMROH PRIVATE BUSINESS CLASS ALA SULTAN', '<p>UMROH VVIP: RASAKAN SENSASI UMROH ALA SULTAN! ?</p>\n<p>Siapa bilang perjalanan umroh harus melelahkan? Kini, Anda bisa merasakan pengalaman ibadah yang berbeda dengan layanan Umroh Private VVIP Business Class!</p>\n<p>Dengan fasilitas premium, Anda akan menikmati perjalanan yang jauh dari kata repot. Mulai dari kenyamanan maskapai penerbangan terbaik hingga akomodasi mewah yang tepat di depan Masjidil Haram, perjalanan umroh Anda dijamin tak terlupakan!</p>\n<p>Nikmati Fasilitas Bintang 5: Kenyamanan Maksimal untuk Ibadah Anda!</p>\n<p>- Menginap di Hotel Bintang 5:<br>Bayangkan bangun tidur dan melihat Masjidil Haram tepat di depan mata! Dengan menginap di Hotel Bintang 5 Spesial di Mekkah dan Madinah, Anda hanya perlu berjalan kaki nol meter untuk sampai ke Masjidil Haram dan Masjid Nabawi. Tidak perlu khawatir dengan jarak dan transportasi, karena hotel ini menawarkan akses super dekat dan kenyamanan kelas atas.</p>\n<p>- Terbang Nyaman dengan Garuda Indonesia Business Class:<br>Perjalanan panjang menuju tanah suci akan terasa singkat dengan kenyamanan Business Class Garuda Indonesia. Dari mulai take-off di Jakarta, Anda akan merasakan pelayanan premium, tempat duduk yang lebih luas, dan makanan berkualitas tinggi. Bersiaplah untuk pengalaman terbang yang membuat Anda rileks dan siap menjalankan ibadah dengan khusyuk.</p>\n<p>- Layanan Private &amp; Eksklusif:<br>Kami tahu bahwa kenyamanan dan ketenangan adalah hal utama bagi Anda. Itulah mengapa kami menyediakan layanan private dan eksklusif selama perjalanan umroh Anda. Dengan pemandu profesional dan tim yang siap membantu 24/7, perjalanan ibadah Anda akan berjalan lancar tanpa ada yang terlewatkan.</p>\n<p>&nbsp;</p>\n<p>Promo 10.10 Spesial: Cashback hingga Rp 5.000.000! ????</p>\n<p>Promo terbatas hanya sampai 10 Oktober 2024! Manfaatkan kesempatan emas ini untuk mendapatkan cashback hingga Rp 5.000.000 saat Anda mendaftar paket Umroh Private VVIP Business Class. Dapatkan pengalaman ibadah eksklusif dengan harga spesial yang jarang Anda temui!</p>\n<p>&nbsp;</p>\n<p>Daftar Sekarang, Seat Terbatas!</p>\n<p>Ingin tahu rasanya menjalankan ibadah umroh dengan layanan terbaik dan kenyamanan maksimal? Jangan sampai kehabisan seat untuk program eksklusif ini! Segera hubungi kami dan amankan tempat Anda:</p>\n<p>08113003258<br>081133360600<br>Kunjungi website kami di <a href=\"http://www.rosanatravel.com\">www.rosanatravel.com</a><br>Follow kami di Instagram: @rosanatourtravel<br>Like Facebook kami: Rosana Tour And Travel<br>Ikuti TikTok kami: @rosana_travel<br>Subscribe YouTube kami: Rosana Travel</p>\n<p>&nbsp;</p>\n<p>Jangan tunggu lama-lama! Segera ambil kesempatan ini untuk merasakan Umroh VVIP Ala Sultan dengan kenyamanan terbaik dan fasilitas eksklusif. Yuk, jadikan momen umroh Anda lebih berkesan bersama Rosana Travel!</p>', 'e1fc7c523d38b91c14be0ba948969310.png', 'Rosana Travel', '2024-10-08 11:49:16'),
(16, 'WISATA HALAL TOUR', 'WARISAN UNESCO JALUR PERDAGANGAN PERADABAN KUNO DUNIA DENGAN BERIBU SEJARAH', '<p><strong>AL-ULA</strong></p><p>Umroh Plus Al-Ula adalah paket perjalanan yang menggabungkan ibadah Umroh di Makkah dan Madinah dengan kunjungan ke Al-Ula, sebuah kota bersejarah yang kaya akan situs arkeologi dan keindahan alam. Menambahkan Al-Ula dalam paket Umroh memberikan manfaat lebih bagi para jamaah, baik dari segi spiritual, wisata, maupun budaya.</p><p>Al-Ula adalah sebuah kota yang terletak di bagian barat Arab Saudi, sekitar 300 kilometer ke utara Madinah. Terletak di antara dua pegunungan dan gurun pasir, Al-Ula memiliki lanskap yang menakjubkan, yang dipadukan dengan sejarah panjang dan budaya yang kaya. Kota ini dikenal sebagai salah satu destinasi wisata yang menawarkan pemandangan alam yang luar biasa, situs-situs arkeologi yang mengesankan, serta warisan sejarah yang mendalam.</p><p>Al-Ula memiliki peran penting dalam sejarah Timur Tengah, baik dalam jalur perdagangan maupun sebagai tempat persinggahan karavan kuno yang melintasi wilayah tersebut. Di sana terdapat banyak situs kuno yang mencerminkan peradaban yang pernah berkembang, seperti kerajaan Nabatea yang terkenal dengan ibu kotanya di Petra, Yordania. Salah satu situs paling terkenal di Al-Ula adalah Mada’in Saleh (juga dikenal sebagai Al-Hijr), yang merupakan situs warisan dunia UNESCO dengan makam-makam batu yang dipahat dalam tebing-tebing besar.</p><p>Keindahan Al-Ula tidak hanya terletak pada kekayaan sejarahnya, tetapi juga pada lanskap alamnya yang memukau. Kota ini dikelilingi oleh formasi batuan yang luar biasa, lembah-lembah yang hijau, serta gurun yang mempesona. Salah satu daya tarik utama Al-Ula adalah Mada\'in Saleh, sebuah situs arkeologi yang terkenal dengan monumen batu yang berusia ribuan tahun, yang dibangun oleh kerajaan Nabatea sekitar abad pertama Masehi.</p><p>Al-Ula terkenal dengan keindahan alamnya yang luar biasa. Jemaah yang mengikuti Umroh Plus Al-Ula dapat menikmati pemandangan gurun yang mempesona, gunung-gunung yang menjulang tinggi, serta lembah-lembah yang hijau. Kunjungan ke tempat-tempat alami ini memberikan kedamaian dan ketenangan, yang sangat mendalam bagi jiwa setelah menjalani ibadah di Makkah dan Madinah.<strong> </strong>Pemandangan matahari terbenam di Al-Ula atau berkeliling di oasis yang subur menawarkan kesempatan bagi jemaah untuk merenung, melakukan kontemplasi, dan merasakan kedamaian yang luar biasa.</p><p>Bagi umat Muslim, mengunjungi tempat-tempat ini dapat menjadi kesempatan untuk merenungkan perjalanan sejarah umat manusia, terutama dengan keberadaan kota-kota kuno yang pernah menjadi bagian dari jalur perdagangan yang dilalui oleh Nabi Muhammad dan para sahabat.</p><p>Tunggu apalagi yuk melaksanakan ibadah umroh dan Explore Al-Ula agar kita bisa merasakan manfaat yang lebih dari sekadar ibadah fisik. Jemaah tidak hanya mendapatkan kesempatan untuk menjalankan rukun Islam dengan sempurna, tetapi juga memperkaya diri dengan pengetahuan sejarah, keindahan alam, dan budaya yang memperdalam makna perjalanan spiritual mereka. Dengan mengunjungi Al-Ula, jamaah dapat merasakan kedamaian, kedekatan dengan Allah, serta menghargai warisan sejarah umat manusia yang melingkupi tanah suci ini. Rosana Travel merupakan jasa travel haji, umroh dan halal tour terbaik di Jawa Timur. Kami siap melayani anda dengan profesional, anda tinggal duduk manis dan serahkan seluruh kebutuhan transportasi dan akomodasi anda kepada kami.</p><p> </p>', 'f53d964ce3f8210eacb56c1d185ccd28.png', 'Rosana Travel', '2024-11-26 09:49:30'),
(17, 'WISATA HALAL TOUR', 'KENDARAAN MELAJU SENDIRI DI JABAL MAGNET, BENARKAH ADA KEKUATAN MISTERIUS?!', '<p><strong>JABAL MAGNET</strong></p><p>Selain melaksanakan ibadah di Masjidil Haram, banyak jamaah umroh yang juga tertarik untuk mengunjungi berbagai situs alam di sekitar Mekkah, salah satunya adalah Jabal Magnet. Jabal Magnet atau biasa disebut \"Gunung Magnet\" adalah salah satu fenomena alam yang menarik perhatian para wisatawan dan ilmuwan di berbagai belahan dunia. Terletak di wilayah yang masih cukup jarang dikunjungi oleh banyak orang, Jabal Magnet dikenal karena memiliki daya tarik magnet yang sangat kuat, yang memberikan pengalaman unik bagi siapa saja yang mengunjungi tempat ini.</p><p>Jabal Magnet terletak di wilayah Arab Saudi, lebih tepatnya di daerah Magnet Mountain, yang merupakan bagian dari rangkaian pegunungan yang menambah pesona alam Arab. Jabal Magnet sebenarnya adalah sebuah fenomena alam yang jarang terjadi, yang muncul akibat adanya medan magnet alami yang sangat kuat di area tersebut. Fenomena ini membuat benda-benda logam yang ada di sekitar gunung terasa tertarik ke arah tertentu atau bahkan dapat bergerak tanpa ada penjelasan ilmiah yang memadai. Hal ini menjadi daya tarik utama bagi wisatawan yang ingin merasakan sensasi unik.</p><p>Keindahan Jabal Magnet terletak pada pemandangan alamnya yang menakjubkan. Gunung ini dikelilingi oleh hamparan gurun yang luas, yang memberikan panorama gurun yang indah. Terdapat bentangan padang pasir yang berwarna kuning kecokelatan, serta formasi bebatuan yang unik dan menarik untuk dijelajahi.</p><p>Selain itu, suasana yang tenang di sekitar gunung ini sangat kontras dengan kehidupan kota yang sibuk. Keindahan alam yang alami, jauh dari polusi dan keramaian, menciptakan pengalaman yang menenangkan bagi pengunjung yang datang. Keindahan gunung ini tidak hanya berasal dari pemandangan visualnya, tetapi juga dari fenomena magnetnya yang misterius. Sebagai salah satu keajaiban alam, gunung ini menarik perhatian banyak ilmuwan dan peneliti yang ingin memahami fenomena magnetik yang terjadi di daerah ini. Jabal Magnet terletak di kawasan yang relatif terpencil, yang menjadikannya tempat yang cukup eksklusif dan jarang ditemukan di peta wisata utama.</p><p>Selain itu, lokasi Jabal Magnet yang berada di Arab Saudi membuat tempat ini kaya akan nilai historis dan budaya. Meskipun memiliki medan magnet yang aneh, gunung ini juga berfungsi sebagai situs alam yang mendalam dalam konteks budaya dan geologi.</p><p>Jabal Magnet juga memiliki beberapa manfaat, baik dari sisi ilmiah maupun sebagai objek wisata, antara lain:</p><p><strong>Penelitian Ilmiah</strong></p><p>Jabal Magnet menjadi objek penelitian yang menarik bagi para ilmuwan geologi dan fisika, khususnya yang berkaitan dengan fenomena medan magnet alam. Peneliti menggunakan gunung ini untuk mempelajari interaksi medan magnet dengan lingkungan sekitar dan bagaimana hal itu mempengaruhi perilaku benda-benda logam. Penelitian ini berpotensi untuk menambah pemahaman kita tentang fenomena magnetik alam yang dapat dimanfaatkan dalam bidang teknologi dan energi.</p><p><strong>Sumber Edukasi</strong></p><p>Keunikan Jabal Magnet menjadikannya sebagai sumber edukasi yang menarik bagi siswa dan mahasiswa yang belajar geografi, fisika, atau ilmu bumi. Pengalaman langsung dapat membantu meningkatkan pemahaman mereka tentang medan magnet dan sifat-sifat alam yang jarang terjadi.</p><p><strong>Manfaat Spiritual dan Psikologis</strong></p><p>Selain manfaat ilmiah dan wisata, Jabal Magnet juga memberikan manfaat psikologis bagi pengunjung yang datang. Suasana tenang di sekitar gunung ini sering dianggap dapat memberikan ketenangan batin dan kedamaian pikiran, terutama bagi mereka yang datang untuk melepaskan diri dari rutinitas sehari-hari. Banyak orang yang menganggap gunung ini sebagai tempat yang penuh dengan energi positif.</p><p>Jadi tunggu apalagi Yuk umroh dan Explore Jabal Magnet agar kita bisa Melihat fenomena alam yang luar biasa dan penuh misteri seperti Jabal Magnet bisa menambah rasa syukur kita terhadap ciptaan Tuhan yang luar biasa. Setiap kejadian alam adalah bukti kebesaran dan kuasa Allah SWT yang patut dipahami dengan hati yang penuh rasa takjub. Rosana Travel merupakan jasa travel haji, umroh dan halal tour terbaik di Jawa Timur. Kami siap melayani anda dengan profesional, anda tinggal duduk manis dan serahkan seluruh kebutuhan transportasi dan akomodasi anda kepada kami.</p>', '26ec4a0258d3ed705dfa4f88bff63723.png', 'Rosana Travel', '2024-11-26 10:03:14'),
(18, 'RAUDHAH', 'RAUDHAH DI MADINAH DITUTUP : PENGUMUMAN PENTING DARI ARAB SAUDI', '<p>Pada tanggal 16 Januari 2025, pemerintah Arab Saudi mengumumkan bahwa Raudhah di Masjid Nabawi, Madinah, sementara ditutup untuk umum. Penutupan ini dimulai pada tanggal 19 Januari 2025 dan dijadwalkan dibuka kembali pada tanggal 22 Januari 2025 setelah pekerjaan perbaikan selesai. Informasi ini menjadi perhatian besar bagi umat Muslim di seluruh dunia, terutama bagi para jamaah yang sedang melaksanakan ibadah Umrah atau memiliki rencana kunjungan ke Masjid Nabawi dalam waktu dekat.</p><h4>Apa itu Raudhah?</h4><p>Raudhah adalah salah satu tempat paling suci di Masjid Nabawi yang sering disebut sebagai \"Taman Surga\". Lokasinya berada di antara mimbar dan makam Nabi Muhammad SAW. Raudhah dikenal sebagai tempat yang penuh berkah, dan banyak umat Islam yang berupaya untuk berdoa di sana karena keutamaannya yang sangat besar.</p><h4>Alasan Penutupan</h4><p>Penutupan sementara Raudhah dilakukan karena adanya pekerjaan perbaikan di area tersebut. Pemerintah Arab Saudi ingin memastikan bahwa fasilitas di Raudhah tetap terjaga dengan baik untuk kenyamanan dan keselamatan para jamaah.</p><h4>Jamaah Rosana Travel Berkesempatan Istimewa</h4><p>Alhamdulillah, atas pertolongan Allah SWT, jamaah Rosana Travel diberi kesempatan istimewa untuk masuk ke Raudhah tepat pada saat detik-detik pertama pembukaannya kembali setelah perbaikan pada tanggal 22 Januari 2025. Kami memiliki beberapa grup keberangkatan dari Indonesia, yaitu pada tanggal 16, 18, 21, dan 23 Januari 2025. Keberangkatan ini menjadi momen yang sangat berarti bagi jamaah kami, terutama bagi mereka yang dapat merasakan pengalaman luar biasa di Raudhah setelah pembukaannya.</p><h4>Dampak bagi Jamaah</h4><p>Penutupan sementara ini tentunya berdampak pada pengalaman ibadah para jamaah, terutama yang telah merencanakan untuk berkunjung dan berdoa di Raudhah. Namun, jamaah tetap dapat melaksanakan ibadah lain di Masjid Nabawi, termasuk shalat berjamaah, berdoa, dan membaca Al-Qur\'an di area masjid yang luas.</p><h4>Informasi Selanjutnya</h4><p>Para jamaah diimbau untuk terus memantau informasi terkini dari otoritas resmi Arab Saudi atau pihak penyelenggara perjalanan umrah masing-masing. Pastikan untuk mengikuti arahan petugas setempat dan mematuhi aturan yang berlaku.</p><h4>Penutup</h4><p>Kami bersyukur bahwa pekerjaan perbaikan telah selesai, dan Raudhah kini telah dibuka kembali pada tanggal 22 Januari 2025. Semoga para jamaah dapat kembali merasakan berkah dan ketenangan beribadah di tempat yang mulia ini. Mari kita terus mendoakan agar segala urusan umat Islam di seluruh dunia dimudahkan oleh Allah SWT.</p><p>Untuk informasi lebih lanjut mengenai perkembangan ini, tetap ikuti blog kami dan pastikan Anda mendapatkan berita terkini langsung dari sumber terpercaya.</p>', '87f393a530ba8870fff981beed25e9f9.png', 'Rosana Travel', '2025-01-23 12:55:30');
INSERT INTO `artikel` (`id_artikel`, `kategori`, `judul_artikel`, `konten`, `artikel_img`, `travel`, `created_at`) VALUES
(19, 'RAUDHAH', 'PENGUMUMAN TERBARU: RAUDHAH DI MADINAH DITUTUP UNTUK PERBAIKAN, DIBUKA KEMBALI 22 JANUARI 2025', '<p>Alhamdulillah, puji syukur kita panjatkan kepada Allah SWT yang telah memberikan kesempatan dan kemudahan kepada kita semua. Kami ingin menginformasikan perkembangan terbaru mengenai Raudhah di Masjid Nabawi, Madinah, yang baru-baru ini mengalami penutupan sementara.</p><p>Pada tanggal 16 Januari 2025, pihak berwenang di Arab Saudi mengumumkan bahwa Raudhah, area yang sangat dicintai oleh para jamaah untuk berdoa dan beribadah, akan ditutup sementara untuk keperluan perbaikan. Penutupan ini dilakukan untuk memastikan kenyamanan dan keselamatan para jamaah yang datang dari berbagai belahan dunia, mengingat pentingnya menjaga kualitas dan kebersihan area tersebut.</p><p>Raudhah adalah salah satu tempat paling suci di Masjid Nabawi, yang terletak di dalam area Masjid Nabawi di Madinah. Tempat ini dikenal sebagai salah satu tempat yang memiliki keberkahan luar biasa, karena sesuai dengan sabda Rasulullah SAW, \"Antara rumahku dan mimbarku adalah taman dari taman surga.\" Oleh karena itu, penutupan Raudhah untuk perbaikan adalah langkah yang sangat penting demi meningkatkan kenyamanan bagi setiap jamaah yang beribadah di sana.</p><p><strong>Perbaikan dan Pembukaan Kembali Raudhah</strong></p><p>Raudhah sempat ditutup pada tanggal 16 Januari 2025 dan dijadwalkan untuk dibuka kembali pada 22 Januari 2025. Meskipun penutupan ini berlangsung singkat, para jamaah yang datang ke Madinah tentu merasa khawatir karena mereka sangat menantikan kesempatan untuk berdoa di tempat yang penuh berkah ini. Namun, alhamdulillah, pada tanggal 22 Januari 2025, Raudhah kembali dibuka dengan kondisi yang lebih baik dan lebih nyaman.</p><p>Kami sangat bersyukur, jamaah Nipindo Travel yang berangkat pada waktu yang tepat mendapatkan kesempatan yang luar biasa untuk mengunjungi Raudhah segera setelah dibuka kembali. Pada detik-detik pertama pembukaan Raudhah setelah perbaikan, jamaah kami diberi kesempatan untuk berdoa di tempat yang penuh keberkahan ini, berkat pertolongan Allah SWT. Ini adalah momen yang sangat spesial dan menjadi pengalaman yang tak terlupakan bagi seluruh jamaah yang ikut serta.</p><p><strong>Jamaah Nipindo Travel: Keberangkatan dari Indonesia</strong></p><p>Sebagai agen perjalanan yang telah berpengalaman melayani perjalanan ibadah Umrah dan Haji, kami di Nipindo Travel dengan bangga menginformasikan bahwa kami memiliki beberapa grup keberangkatan dari Indonesia yang terjadwal pada tanggal-tanggal berikut:</p><ul><li>16 Januari 2025</li><li>18 Januari 2025</li><li>21 Januari 2025</li><li>23 Januari 2025</li></ul><p>Kami memahami betapa berharganya momen ibadah di Madinah, terlebih untuk bisa berdoa di Raudhah. Oleh karena itu, kami terus berusaha untuk memastikan bahwa setiap jamaah yang berangkat bersama Nipindo Travel mendapatkan pelayanan terbaik dan kesempatan yang maksimal untuk beribadah dengan nyaman.</p><p><strong>Momen Spesial di Raudhah: Doa dan Harapan</strong></p><p>Raudhah adalah tempat yang sangat istimewa bagi setiap muslim, dan kesempatan untuk bisa beribadah di sana adalah impian bagi banyak orang. Setiap doa yang dipanjatkan di Raudhah memiliki nilai yang sangat besar, apalagi jika dilakukan dengan niat yang tulus dan penuh harapan. Kami sangat bersyukur bahwa jamaah Nipindo Travel dapat beribadah di Raudhah di saat yang tepat, setelah area tersebut dibuka kembali.</p><p>Bagi kami, keberhasilan ini bukan hanya berkat usaha tim kami, tetapi juga merupakan anugerah dari Allah SWT. Kami berharap setiap doa yang dipanjatkan oleh jamaah kami selama beribadah di Raudhah dikabulkan oleh Allah dan membawa keberkahan yang melimpah bagi mereka dan keluarga mereka.</p><p><strong>Kami Terus Berkomitmen untuk Melayani Jamaah dengan Baik</strong></p><p>Sebagai bagian dari Nipindo Travel, kami selalu berkomitmen untuk memberikan pengalaman ibadah terbaik bagi setiap jamaah yang berangkat bersama kami. Kami berusaha memastikan bahwa perjalanan ibadah mereka berjalan lancar, aman, dan nyaman. Dalam setiap keberangkatan, kami memberikan perhatian penuh terhadap kebutuhan dan kenyamanan jamaah, serta memfasilitasi mereka untuk mendapatkan momen-momen berharga seperti berdoa di Raudhah dan tempat-tempat suci lainnya.</p><p>Semoga Allah SWT senantiasa memudahkan perjalanan ibadah seluruh jamaah dan memberikan mereka kelancaran serta keberkahan. Terima kasih atas kepercayaan yang telah diberikan kepada Nipindo Travel. Kami akan terus berusaha untuk memberikan layanan terbaik dan menjadi mitra yang dapat diandalkan dalam perjalanan ibadah Anda.</p>', 'a9f64868599f095362000ce173739a4d.png', 'Nipindo Travel', '2025-01-23 13:17:57'),
(20, 'Halal Tour', 'Menggabungkan Ziarah Spiritual dan Eksplorasi Keajaiban Mesir', '<p>Bagi umat Muslim, ibadah umroh adalah salah satu momen yang sangat dinantikan untuk dapat melaksanakan rukun Islam kedua di Tanah Suci, Makkah dan Madinah. Namun, tak jarang banyak yang ingin menggabungkan perjalanan spiritual ini dengan wisata sejarah dan budaya Islam yang kaya. Salah satu destinasi yang sangat cocok untuk dikunjungi setelah melaksanakan ibadah umroh adalah Cairo, ibu kota Mesir yang terkenal dengan warisan sejarah dan peradaban Islam yang sangat kuat. Program <i>Umroh Plus Tour Cairo</i> menjadi pilihan ideal untuk menggabungkan ibadah umroh dengan pengalaman wisata sejarah yang luar biasa.</p><p>Umroh Plus Tour Cairo adalah paket perjalanan yang menawarkan kombinasi ibadah umroh di Makkah dan Madinah dengan tur wisata ke kota Cairo di Mesir. Setelah menunaikan ibadah umroh, jamaah akan melanjutkan perjalanan ke Cairo untuk mengunjungi situs-situs bersejarah yang terkenal, seperti Piramida Giza, Museum Mesir, Masjid Muhammad Ali, serta tempat-tempat bersejarah lainnya.</p><p><strong>Sejarah Cairo</strong></p><p>Cairo memiliki sejarah panjang yang membentang lebih dari seribu tahun. Kota ini pertama kali didirikan pada abad ke-10 oleh dinasti Fatimiyah sebagai ibu kota negara dan pusat kekuasaan Islam. Meskipun peradaban Mesir kuno telah ada jauh sebelum itu, Cairo sebagai kota modern mulai berkembang pesat sejak abad ke-7 ketika Islam masuk ke Mesir.</p><p>Pada masa kekuasaan Dinasti Mamluk (1250–1517), Cairo menjadi pusat perdagangan dan pembelajaran dunia Islam, dengan banyak bangunan megah, masjid, dan madrasah yang masih dapat ditemukan hingga saat ini. Kemudian, kota ini menjadi bagian dari berbagai kekaisaran, termasuk Kesultanan Ottoman, hingga akhirnya Mesir menjadi negara modern pada abad ke-19 di bawah kekuasaan Inggris dan kemudian merdeka pada tahun 1952.</p><p><strong>Keajaiban Sejarah di Cairo</strong></p><p>Salah satu alasan utama Cairo menarik banyak pengunjung adalah warisan sejarah dan budaya yang sangat kaya. Beberapa situs bersejarah yang wajib dikunjungi di Cairo antara lain:</p><ol><li><strong>Piramida Giza</strong><br>Terletak di pinggiran kota, Piramida Giza adalah salah satu dari Tujuh Keajaiban Dunia Kuno yang masih berdiri hingga hari ini. Kompleks piramida ini, yang mencakup Piramida Khufu, Khafre, dan Menkaure, merupakan makam raja-raja Mesir kuno dan merupakan simbol kebesaran peradaban Mesir kuno. Pengunjung dapat melihat keajaiban arsitektur ini secara langsung, bahkan ada kesempatan untuk memasuki piramida dan menjelajahi bagian dalamnya.</li><li><strong>Museum Mesir</strong><br>Museum Mesir yang terletak di Tahrir Square adalah tempat untuk menyaksikan koleksi artefak kuno yang sangat lengkap, termasuk mumi-mumi firaun dan barang-barang bersejarah yang ditemukan di berbagai situs arkeologi Mesir. Salah satu koleksi paling terkenal adalah harta karun dari makam Raja Tutankhamun, yang ditemukan pada tahun 1922.</li><li><strong>Masjid Muhammad Ali dan Citadel of Saladin</strong><br>Terletak di atas bukit yang menawarkan pemandangan spektakuler kota Cairo, Masjid Muhammad Ali adalah contoh arsitektur Ottoman yang megah. Dibangun pada abad ke-19, masjid ini menjadi salah satu simbol kota Cairo. Di kompleks Citadel of Saladin, Anda juga dapat mengunjungi beberapa masjid dan museum yang memperkaya wawasan sejarah Islam di Mesir.</li><li><strong>Khan El Khalili Bazaar</strong><br>Bagi para pecinta belanja dan kebudayaan lokal, pasar tradisional Khan El Khalili adalah tempat yang wajib dikunjungi. Di sini, pengunjung dapat menemukan berbagai macam barang seperti perhiasan, tekstil, rempah-rempah, dan kerajinan tangan yang khas. Pasar ini juga merupakan tempat yang sempurna untuk merasakan kehidupan sehari-hari warga Cairo.</li><li><strong>Masjid Al-Azhar dan Universitas Al-Azhar</strong><br>Salah satu masjid tertua di dunia, Masjid Al-Azhar didirikan pada abad ke-10 dan menjadi pusat penting pendidikan Islam. Universitas Al-Azhar, yang terletak di samping masjid, adalah salah satu lembaga pendidikan tertua di dunia Islam dan terus memainkan peran penting dalam dunia akademik hingga saat ini.</li><li><strong>Makam Imam Syafi\'i</strong>, Makam Imam Syafi\'i terletak di Cairo, Mesir, tepatnya di area Desa Qarmit, dekat dengan Masjid Imam Syafi\'i. Imam Syafi\'i adalah salah satu imam besar dalam dunia Islam dan pendiri mazhab Syafi\'i, yang memiliki pengaruh besar dalam hukum Islam. Makamnya di Cairo menjadi tempat ziarah bagi umat Muslim yang ingin menghormati dan berdoa di dekat makam seorang ulama besar. Masjid yang dibangun di dekat makam Imam Syafi\'i juga menjadi tempat yang penting dalam tradisi Islam, mengingat kontribusinya dalam menyebarkan ilmu dan syariat Islam. Jika Anda berkesempatan berkunjung ke Cairo, makam Imam Syafi\'i adalah salah satu situs bersejarah yang penuh dengan nilai spiritual.</li></ol><p>Cairo adalah kota yang memikat hati dengan pesona sejarah, budaya, dan kehidupan kota yang tak pernah tidur. Dengan kombinasi antara situs-situs bersejarah yang luar biasa, kehidupan kota yang modern, serta kekayaan tradisi dan kuliner yang khas, Cairo menawarkan pengalaman wisata yang sangat beragam dan tak terlupakan. Bagi siapa saja yang mencari pemahaman lebih dalam tentang peradaban Mesir kuno atau yang ingin merasakan kehidupan kota Arab yang kaya, Cairo adalah destinasi yang wajib dikunjungi. Umroh Plus Tour Cairo adalah pilihan sempurna bagi mereka yang ingin menyempurnakan ibadah umroh dengan menjelajahi sejarah Islam dan kebudayaan Mesir yang kaya. Melalui perjalanan ini, jamaah tidak hanya mendapatkan kesempatan untuk memperdalam spiritualitas mereka, tetapi juga memperluas pengetahuan tentang sejarah Islam dan dunia kuno yang penuh dengan keajaiban. Dengan pemandu wisata yang berpengalaman, kenyamanan perjalanan yang terjamin, dan pengalaman berharga yang tak terlupakan, paket umroh plus Cairo menjadi solusi wisata religi yang sangat menarik.</p><p>Mari bergabung bersama kami dalam perjalanan yang penuh berkah dan pengalaman luar biasa, <strong>Umroh Plus Tour Cairo bersama Travel Nipindo</strong>. Tidak hanya menunaikan ibadah umroh di tanah suci, tetapi juga memperluas wawasan dengan mengunjungi situs-situs bersejarah di Cairo, seperti Piramida Giza, Museum Mesir, dan Masjid Imam Syafi\'i. Rasakan keistimewaan ibadah dan sejarah dalam satu perjalanan yang tak terlupakan. Daftarkan diri Anda sekarang dan jadikan perjalanan spiritual ini lebih bermakna bersama kami!\"</p>', '523c5d2bf4426081cf0772d7148146b7.jpeg', 'Nipindo Travel', '2025-02-07 11:01:25');
