(103, '39', 'Umroh', NULL, 'Rosana Travel', 'UMROH NISFU SYA\'BAN', 'VIP', 'HILTON HOTEL MEKKAH', '*', '5', '5', 12, 'Rp', '5000000', 'Rp', '36000000', 'Tiket Pesawat Economy Class • Asuransi perjalanan & Covid-19 (mengcover resiko Covid-19) • Akomodasi Hotel di Mekkah & Medinah(Sesuai Pilihan Paket Umroh) • 2 kali Umrah, 1x city tour di Mekkah & Medinah (kondisional) • Makan prasmanan 3x sehari (Full Board Hotel / Box). • Transportasi Bus AC. • Muthawif / Pembimbing Ibadah.  Catatan : • Membawa Air Zam-Zam (Liquid) per 18 Mei 2022 sudah tidak diijinkan oleh semua Airlines (mengikuti peraturan dari GACA).', 'Biaya Handling Bandara, Fasilitas Ibadah, Manasik • Biaya PCR di Saudi  • Biaya Pengurusan Paspor (Jika belum punya/sudah tidak berlaku) • Biaya Suntik Meningitis. • Biaya Surat Mahram (Bagi wanita usia dibawah 45 Tahun yang berangkat sendirian) • Biaya Pajak Saudi (municipility 5% & VAT 15%) & Biaya Pajak Indonesia (PPN11%).. Jika sudah diberlakukan • Biaya Tour / Makan / Minum diluar program. • Biaya lain-lain yang bersifat pribadi : Telepon, Laundry, Tips, Kelebihan Bagasi, dll.', '483426283f5606f8fb4675aebbc4991e.jpg', '', 'Uang Muka', '0', '1', '', 1),
(104, '38', 'Tour', NULL, 'Rosana Travel', 'TOUR TURKEY HOLIDAY', 'VIP', '*', '*', '5', '5', 8, 'Rp', '10000000', 'Rp', '389000000', '', '', 'fa355c10ff69657bc67537c39a02b0b7.jpg', '', '', '0', '1', '<p>Taukah anda bahwa Turki adalah negara yang pertama dan satu-satunya yang telah membuka pintu wisata untuk&nbsp; para wisatawan dari berbagai&nbsp; mancanegara, salah satunya adalah Indonesia . Pada tanggal 24 Juni 2020, Turki mengenalkan “<i>Safe Tourism Certificated Programme</i>” untuk mendukung upaya mengembalikan pariwisata dengan memperhatikan protokol kesehatan.&nbsp; Dikutip dari laman&nbsp;<a href=\"http://www.tga.gov.tr/\">www.tga.gov.tr</a>, program “<i>Safe Tourism Certificated</i>” merupakan serangkaian tindakan ekstensif yang meliputi transportasi dan akomodasi untuk semua warga negara Turki dan pengunjung Internasional yang akan liburan ke Turki,&nbsp; juga kesejahteraan dan kondisi kesehatan penumpang/tamu dan karyawan yang bekerja di fasilitas wisata.</p><p>Turki menjadi destinasi liburan yang mencakup keindahan dua benua yakni Eropa dan Asia, selain itu Turki juga dikenal sebagai Negeri Sejuta Sejarah Islam. Berikut adalah 4 destinasi wajib saat liburan ke turki:</p><ol><li>Hagia Sophia, Topkapi Palace, Blue Mosque Hippodrome</li><li>Capadocia</li><li>Grand Mosque, Silk Market, Ancient City, Hierapolis</li><li>Ankara City Tour</li></ol><p>Bagi anda yang ingin liburan aman dimasa pandemi, Turki merupakan salah satu negara yang paling kami rekomendasikan. Biaya yang dikeluarkan cukup&nbsp;<i>affordable</i>&nbsp;dengan destinasi wisata yang cantik dan unik, bersejarah dan pengalaman yang tak akan terlupakan.&nbsp; Jadi tidak usah ragu lagi untuk liburan ke Turki. Rosana Travel merupakan jasa travel halal tour terbaik di Jawa Timur. Cukup dengan pasport saja, anda sudah bisa liburan ke Turki. Kami siap melayani anda dengan profesional, anda tinggal duduk manis dan serahkan seluruh kebutuhan transportasi dan akomodasi anda liburan ke Turki kepada kami. Informasi cepat dan pelayanan tepat hubungi marketing kami</p><p>081-3003-258</p><p>Kunjungi kami di sosial media kami<br>Instagram : @rosanatourtravel<br>Facebook : RosanaTourAndTravel<br>Youtube : Rosana Travel</p>', 1),
