(189, '78', 'Umroh', NULL, 'Rosana Travel', 'TOUR LINTAS 3 NEGARA - FULL PESAWAT', 'VIP', '*', '*', '5', '5', 6, 'Rp', '10000000', 'Rp', '299000000', 'Tiket Pesawat Economy Class • Asuransi perjalanan & Covid-19 (mengcover resiko Covid-19) • Akomodasi Hotel di Mekkah & Medinah(Sesuai Pilihan Paket Umroh) • 2 kali Umrah, 1x city tour di Mekkah & Medinah (kondisional) • Makan prasmanan 3x sehari (Full Board Hotel / Box). • Transportasi Bus AC. • Muthawif / Pembimbing Ibadah.  Catatan : • Membawa Air Zam-Zam (Liquid) per 18 Mei 2022 sudah tidak diijinkan oleh semua Airlines (mengikuti peraturan dari GACA).', 'Biaya Handling Bandara, Fasilitas Ibadah, Manasik • Biaya PCR di Saudi  • Biaya Pengurusan Paspor (Jika belum punya/sudah tidak berlaku) • Biaya Suntik Meningitis. • Biaya Surat Mahram (Bagi wanita usia dibawah 45 Tahun yang berangkat sendirian) • Biaya Pajak Saudi (municipility 5% & VAT 15%) & Biaya Pajak Indonesia (PPN11%).. Jika sudah diberlakukan • Biaya Tour / Makan / Minum diluar program. • Biaya lain-lain yang bersifat pribadi : Telepon, Laundry, Tips, Kelebihan Bagasi, dll.', 'eb79e92567e1bbfd8f7d2f7055f90e82.jpeg', '', 'Uang Muka', '0', '1', '<h4>Detail Paket</h4><p> </p><ul><li>HALAL TOUR TIGA NEGARA ( KUALA LUMPUR – BANGKOK – SINGAPORE)<br>Pernahkah Anda membayangkan sebuah petualangan yang menggabungkan keanekaragaman budaya, arsitektur yang memukau, serta kelezatan kuliner dari tiga negara yang berbeda? Jika iya, maka tour tiga negara yang mengunjungi Kuala Lumpur, Bangkok, dan Singapura mungkin adalah pilihan tepat untuk Anda. Setiap kota menawarkan pengalaman yang unik dan tak terlupakan bagi para wisatawan. Mari kita eksplorasi lebih dalam apa yang bisa anda harapkan dari setiap destinasi ini.<br>Kuala Lumpur, Malaysia: Modernitas dengan Sentuhan Budaya&nbsp;.</li></ul><p> </p><ul><li><strong>Kuala Lumpur Adalah ibukota Malaysia</strong>, perpaduan harmonis antara kemodernan dan warisan budaya yang kaya. Salah satu ikonnya adalah Menara Kembar Petronas yang megah, yang menawarkan pemandangan spektakuler kota dari ketinggian. Tidak lupa destinasi Kota Pemerintahan Malaysia yaitu Putrajaya yang menyuguhkan keindahan kota sebagai destinasi tak biasa di Malaysia. Nantinya kita akan mengunjungi beberapa destinasi wisata di Kuala Lumpur diantaranya : Putrajaya, Istana Negara (Photo Stop), Dataran Merdeka (Photo Stop).<br> </li></ul><p>Bangkok, Thailand: Pusat Kehidupan Malam dan Budaya yang Memikat</p><ul><li><strong>Bangkok adalah ibukota Thailand,</strong> kota yang tak pernah tidur dengan kehidupan malam yang berdenyut. destinasi wisata yang akan kita kunjungi di Bangkok diantaranya : Erawadee Herb Shop, Wat Arun, Wat Pho dengan patung Reclining Buddha-nya dan Istana Kerajaan Grand Palace yang megah menawarkan pengalaman spiritual dan sejarah yang mendalam, makan siang di Restoran Lokal. Lalu ke Honey Bee Shop, Gems Jewerly, Dried Food, dan yang terakhir mengunjungi Asiatique the Riverfront.</li></ul><p> </p><ul><li><strong>Singapore: Metropolis Futuristik dengan Sentuhan Tradisional</strong><br>Singapore menggambarkan masa depan yang futuristik dengan gedung pencakar langit modernnya yang mengagumkan seperti Merlion Park (Photo Stop), Esplanade (Photo Stop), Universal Studio Singapore (Photo Stop), Bugis Street, Orchard Road.</li></ul><p> </p><p>*<strong>Dan perlu digaris bawahi Rosana Travel Selain mengunjungi pusat ibu kota dari tiga negara diatas, kami juga Menggunakan Full by pesawat untuk Lintas Tiga Negara,&nbsp;</strong><br><strong>Makanan yang kami hidangkan juga dijamin 100% Halal</strong>*</p><p>Jadi bagaimana Yuk ikuti kami Explore keindahan 3 Negara Kuala Lumpur - Bangkok – Singapore. Biaya yang dikeluarkan cukup affordable dengan destinasi wisata yang cantik dan unik, bersejarah dan pengalaman yang tak akan terlupakan.  Jadi tidak usah ragu lagi untuk Explore bareng kita mengkelilingi tiga negara. Rosana Travel merupakan jasa travel halal tour terbaik di Jawa Timur. Kami siap melayani anda dengan profesional, anda tinggal duduk manis dan serahkan seluruh kebutuhan transportasi dan akomodasi anda explore tiga negara kepada kami. Informasi cepat dan pelayanan tepat hubungi kami.</p><p><br>08113003258<br>081133360600</p><p><br>www.rosanatravel.com<br>IG: @rosanatourtravel<br>FB: Rosana Tour And Travel<br>YT: Rosana Travel<br>TikTok: https://vt.tiktok.com/ZSYyRmYee/</p>', 1),
