(211, '91', 'Umroh', NULL, 'Nipindo Travel', 'UMROH RAMADHAN NUZULUL QUR\'AN BERSAMA YAI HUDA', 'Standard', 'HOTEL MEKKAH', 'HOTEL MADINAH', '3', '3', 12, 'Rp', '5000000', 'Rp', '42000000', '', '', 'ab39e1c41877105836cdaad5af03961b.jpg', '', '', '0', '1', '<p>Umroh Ramadhan Spesial Nuzulul Qur\'an&nbsp;</p><p>Malam Nuzulul Qur\'an adalah malam dimana malaikat Jibril mengirimkan wahyu kitab suci Al-Qur\'an kepada Nabi Muhammad SAW. di gua hiro<br>Mari sambut bulan suci dengan ibadah penuh khidmat bersama Nipindo Travel<br>Rasulullah SAW bersabda, \"Umroh di bulan Ramadhan setara dengan haji bersamaku.\"&nbsp;<br>Umroh Maka Jadikan Ramadhan tahun ini lebih bermakna dan raih keberkahan ramadhan langsung dari tanah suci</p><p>Jadwal Keberangkatan 09 Maret 2025 (Direct Madinah)&nbsp;<br>&nbsp;Bonus&nbsp;<br>&nbsp; &nbsp; &nbsp;Perlengkapan Ibadah ekslusif&nbsp;<br>&nbsp; &nbsp; &nbsp;Makan Iftar &amp; Sahur<br>&nbsp; &nbsp; &nbsp;Tersedia paket 12 hari&nbsp;</p><p>Rasakan berkah ramadhan di tanah suci dengan layanan terbaik kami &nbsp;dan langsung berangkat bareng kyai kita (KH. NURUL HUDA) ketua MUI Kabupaten Pasuruan. Jangan lewatkan kesempatan istimewa ini!</p>', 1),
