(215, '95', 'Umroh', NULL, 'Nipindo Travel', 'UMROH RAMADHAN SPESIAL LAILATUL QADAR', 'Standard', 'HOTEL MEKKAH', 'HOTEL MADINAH', '5', '3', 15, 'Rp', '5000000', 'Rp', '78000000', 'Tiket Pesawat Economy Class • Asuransi perjalanan & Covid-19 (mengcover resiko Covid-19) • Akomodasi Hotel di Mekkah & Medinah(Sesuai Pilihan Paket Umroh) • 2 kali Umrah, 1x city tour di Mekkah & Medinah (kondisional) • Makan prasmanan 3x sehari (Full Board Hotel / Box). • Transportasi Bus AC. • Muthawif / Pembimbing Ibadah.  Catatan : • Membawa Air Zam-Zam (Liquid) per 18 Mei 2022 sudah tidak diijinkan oleh semua Airlines (mengikuti peraturan dari GACA).', 'Biaya Handling Bandara, Fasilitas Ibadah, Manasik • Biaya PCR di Saudi  • Biaya Pengurusan Paspor (Jika belum punya/sudah tidak berlaku) • Biaya Suntik Meningitis. • Biaya Surat Mahram (Bagi wanita usia dibawah 45 Tahun yang berangkat sendirian) • Biaya Pajak Saudi (municipility 5% & VAT 15%) & Biaya Pajak Indonesia (PPN11%).. Jika sudah diberlakukan • Biaya Tour / Makan / Minum diluar program. • Biaya lain-lain yang bersifat pribadi : Telepon, Laundry, Tips, Kelebihan Bagasi, dll.', '33596c68cc50484c2946716a13abbc73.jpeg', '', 'Uang Muka', '0', '1', '<p> Umroh Istimewa di Malam Lailatul Qadar 2025!!</p><p>Raih kemuliaan dan keberkahan malam yang lebih baik dari seribu bulan dengan beribadah di Tanah Suci. Malam Lailatul Qadar adalah momen yang penuh berkah. Menjalani ibadah umroh dimalam penuh keberkahan, Dimana kita mendapatkan maghfirah, rahmat dan pahala yang dilipat gandakan oleh Allah SWT.<br>Jadikan momen suci ini sebagai langkah mendekatkan diri kepada-Nya dan menggapai ridha-Nya.   </p><p>Bonus Spesial umroh Lailatul Qodar : <br> 10 hari full di Makkah<br>Gratis perlengkapan Ibadah ekslusif <br> Makan Iftar &amp; Sahur</p><p> Umroh Lailatul Qadar dikeberangkatan 17 Maret 2025!</p><p>Jangan lewatkan kesempatan emas ini untuk meraih pahala dan beribadah nyaman dengan fasilitas hotel dekat dengan pelataran. <br>Nipindo Travel siap menemani Anda untuk meraih pahala yang luar biasa dengan pengalaman ibadah yang tak terlupakan!!!</p>', 1);
