(217, '94', 'Tour', NULL, 'Nipindo Travel', 'HALAL TOUR 3 NEGARA KUALA LUMPUR - BANGKOK - SINGAPORE ', 'Standard', '*', '*', '3', '3', 5, 'Rp', '3000000', 'Rp', '9000000', 'Tiket Pesawat Economy Class • Asuransi perjalanan & Covid-19 (mengcover resiko Covid-19) • Akomodasi Hotel di Mekkah & Medinah(Sesuai Pilihan Paket Umroh) • 2 kali Umrah, 1x city tour di Mekkah & Medinah (kondisional) • Makan prasmanan 3x sehari (Full Board Hotel / Box). • Transportasi Bus AC. • Muthawif / Pembimbing Ibadah.  Catatan : • Membawa Air Zam-Zam (Liquid) per 18 Mei 2022 sudah tidak diijinkan oleh semua Airlines (mengikuti peraturan dari GACA).', 'Biaya Handling Bandara, Fasilitas Ibadah, Manasik • Biaya PCR di Saudi  • Biaya Pengurusan Paspor (Jika belum punya/sudah tidak berlaku) • Biaya Suntik Meningitis. • Biaya Surat Mahram (Bagi wanita usia dibawah 45 Tahun yang berangkat sendirian) • Biaya Pajak Saudi (municipility 5% & VAT 15%) & Biaya Pajak Indonesia (PPN11%).. Jika sudah diberlakukan • Biaya Tour / Makan / Minum diluar program. • Biaya lain-lain yang bersifat pribadi : Telepon, Laundry, Tips, Kelebihan Bagasi, dll.', '5422583968f8105b6f2c920a09d0bab2.jpg', '', 'Uang Muka', '0', '1', '<p>Berlibur adalah pengalaman yang mengagumkan dan nikmat. <br>Kami dari Nipindo Tour and Travel dengan bangga menghadirkan Promo Tour Lintas 3 Negara Kuala Lumpur - Bangkok - Singapore<br><br>Yuk explore wisata negara tetangga dengan</p><p>Dengan Harga Spesial </p><p>kamu bisa berangkat dan menikmati keindahan di 3 Negara.</p><p> Segera hubungi kami untuk informasi lebih lanjut dan pendaftarannya. Jangan lewatkan kesempatan emas ini untuk melakukan liburan dengan nyaman dan terjangkau!</p>', 1),
(218, '96', 'Haji', NULL, 'Nipindo Travel', 'HAJI EKSLUSIF FULL HOTEL', 'Semi VIP', 'HOTEL MEKKAH', 'HOTEL MADINAH', '5', '5', 26, 'USD', '5000', 'USD', '21900', 'Tiket Pesawat Economy Class • Asuransi perjalanan & Covid-19 (mengcover resiko Covid-19) • Akomodasi Hotel di Mekkah & Medinah(Sesuai Pilihan Paket Umroh) • 2 kali Umrah, 1x city tour di Mekkah & Medinah (kondisional) • Makan prasmanan 3x sehari (Full Board Hotel / Box). • Transportasi Bus AC. • Muthawif / Pembimbing Ibadah.  Catatan : • Membawa Air Zam-Zam (Liquid) per 18 Mei 2022 sudah tidak diijinkan oleh semua Airlines (mengikuti peraturan dari GACA).', 'Biaya Handling Bandara, Fasilitas Ibadah, Manasik • Biaya PCR di Saudi  • Biaya Pengurusan Paspor (Jika belum punya/sudah tidak berlaku) • Biaya Suntik Meningitis. • Biaya Surat Mahram (Bagi wanita usia dibawah 45 Tahun yang berangkat sendirian) • Biaya Pajak Saudi (municipility 5% & VAT 15%) & Biaya Pajak Indonesia (PPN11%).. Jika sudah diberlakukan • Biaya Tour / Makan / Minum diluar program. • Biaya lain-lain yang bersifat pribadi : Telepon, Laundry, Tips, Kelebihan Bagasi, dll.', '94b60d26037e604ee1a9c1bd35b3c467.jpeg', '', 'Uang Muka', '0', '1', '<p><strong>Haji Eksklusif Nipindo Travel: Perjalanan Ibadah yang Tak Terlupakan.</strong><br>Menghadirkan pengalaman beribadah haji yang istimewa, Haji Eksklusif Nipindo Travel menawarkan layanan unggulan dengan fasilitas bintang lima yang memadukan kenyamanan, kemudahan, dan kebersamaan dalam beribadah.<br><br>Dengan Nipindo Travel, setiap langkah dalam perjalanan spiritual Anda dirancang khusus untuk memberikan pengalaman yang penuh makna dan berkesan.</p><h4>Mengapa Memilih Haji Eksklusif Nipindo Travel?</h4><p>Kami berkomitmen untuk memberikan layanan terbaik dan fasilitas unggulan yang memastikan kenyamanan, kemudahan, dan keberkahan dalam setiap langkah perjalanan Anda. Dengan pengalaman dan profesionalisme dalam menyelenggarakan perjalanan haji, kami siap mendampingi Anda dalam meraih ibadah haji yang mabrur.</p><h4>7 Keunggulan Nipindo Travel</h4><ul><li><strong>Full Hotel *5 Mekkah &amp; *5 Madinah tanpa Pindah ke Hotel Transit / Rumah Transit</strong></li><li><strong>Paket Arbain di Madinah</strong></li><li><strong>Pesantren Haji dibawah bimbingan 2 Pembimbing Ibadah Haji bersertifikasi Nasional</strong></li><li><strong>Mengerjakan rangkaian Haji Full ARMUZNA (Arafah - Muzdalifah - Mina)</strong></li><li><strong>Mendapat Kesempatan Sholat Idul Adha di Masjidil Haram</strong></li><li><strong>Transportasi Bus Mandiri</strong></li><li><strong>Makan Full Fullboard Hotel 3x setiap hari</strong></li></ul>', 1),
